import Navbar from "react-bootstrap/Navbar";
import { Container } from "react-bootstrap";
import OverlayTrigger from "react-bootstrap/OverlayTrigger";
import Tooltip from "react-bootstrap/Tooltip";
import { BsFillCaretUpSquareFill} from "react-icons/bs";
import "./footer.css";

function Footer() {
  return (
    <Navbar bg="light" expand={false} >
      <Container fluid>
      <span className="foot">Made with React JS and BootStrap</span>
      <OverlayTrigger key="bottom" placement="top" overlay={<Tooltip id={`tooltip-top`}>Return to Top</Tooltip>}>
      <BsFillCaretUpSquareFill className="back-up" onClick={(event) => window.open("https://github.com/foofx88", "_blank")}/>
                </OverlayTrigger>

      </Container>
    </Navbar>
  );
}

export default Footer;
